import React, { Component } from 'react';

class Header extends Component {
    render(){

        return(
            <div>
                <div className="User"><i class="fas fa-user-circle"></i></div>
                <div className="Hamburger"><i class="fas fa-bars"></i></div>
            </div>
        )
    }
}

export default Header;
